import React from "react";
import styled from 'styled-components';
import AppHeader from "../../components/AppHeader";

const CategoryBox = styled.div`
    border: 1px solid grey;
`;


const Employment = () => { 
    return(
        <>
            <AppHeader />
                <CategoryBox>
                    <button>
                        전체
                    </button>
                    <div>
                        직군을 선택해주세요.
                    </div>
                </CategoryBox>
        </>
    );
}

export default Employment;
